(6, 'Соглашение о сотрудничестве', 'Пример 1', 'Пример 1', '<p><strong>Добро пожаловать на сайт электронной торговой площадки &laquo;</strong><strong>Samauto</strong><strong>-</strong><strong>Auksion</strong><strong>&raquo;!</strong></p>\r\n\r\n<p>Посещая или используя сайт &laquo;<strong>Samauto</strong><strong>-</strong><strong>Auksion</strong>&raquo;, вы принимаете настоящие условия использования и политику конфиденциальности в полном объеме.</p>\r\n\r\n<p><strong>Принятие условий</strong></p>\r\n\r\n<p>Сайт &laquo;<strong>Samauto</strong><strong>-</strong><strong>Auksion</strong>&raquo; предоставляется на следующих условиях использования (&laquo;Условия&raquo;). Выполняя вход на любую страницу данного сайта, Вы соглашаетесь с этими Условиями. В настоящие Условия, могут периодически вноситься изменения и публиковаться обновлённые Условия без предварительного уведомления.</p>\r\n\r\n<p><strong>Сайт &laquo;</strong><strong>Samauto</strong><strong>-</strong><strong>Auksion</strong><strong>&raquo;</strong></p>\r\n\r\n<p>На данном сайте Вы сможете получать информацию об аукционных торгах по реализации вторичных материальных ресурсов.</p>\r\n\r\n<p><strong>Доступ к сайту и безопасность Вашего аккаунта</strong></p>\r\n\r\n<p>Ваш Аккаунт идентифицируется по предоставленному вами электронному адресу, и вы являетесь единственной стороной, которая вправе использовать ваше имя пользователя (электронный адрес). Вы ответственны за сохранение секретности вашего аккаунта и любых выбранных вами паролей, в ином случае мы можем заблокировать ваш доступ на Сайт. Вы ответственны за любое использование своего аккаунта, вне зависимости от того, было ли оно совершено с вашего разрешения, или нет. Вы соглашаетесь не регистрировать более одного аккаунта на Сайте. Вы не можете регистрироваться под фиктивным именем.</p>\r\n\r\n<p><strong>Ограничения при использовании</strong></p>\r\n\r\n<p>Вы можете использовать Сайт &laquo;<strong>Samauto</strong><strong>-</strong><strong>Auksion</strong>&raquo; только в законных целях в соответствии с настоящими условиями использования, Вы соглашаетесь:</p>\r\n\r\n<ul>\r\n	<li>не использовать сайт любым способом, способным привести к прекращению его работы, перегрузке, вреду или любым иным отрицательным последствиям, а также мешать использованию сайта третьими лицами, включая их способность работать с сайтом в режиме реального времени;</li>\r\n	<li>не использовать роботов или иные автоматические устройства, способы и средства для доступа к сайту с любой целью, включая отслеживание и копирование материалов, размещенных на сайте;</li>\r\n	<li>не отслеживать и копировать размещенные на сайте материалы вручную в любых неавторизованных целях без получения нашего предварительного письменного согласия;</li>\r\n	<li>не использовать любые устройства, программное обеспечение и процедуры, которые могут помешать нормальной работе сайта;</li>\r\n	<li>не внедрять любые вирусы или иные материалы, которые являются вредоносными или технологически вредными;</li>\r\n	<li>не пытаться получить неавторизованный доступ к сайту, препятствовать, вредить или прерывать работу любых разделов сайта, серверов, на которых хранится информация сайта, или любых серверов, компьютеров и баз данных, связанных с сайтом;</li>\r\n	<li>не препятствовать работе сайта через атаку на отказ в обслуживании или распределенную атаку на отказ в обслуживании;</li>\r\n	<li>не препятствовать нормальной работе сайта любым иным способ</li>\r\n</ul>\r\n\r\n<p><strong>Ответственность</strong></p>\r\n\r\n<p>Пользуясь Сайтом &laquo;<strong>Samauto</strong><strong>-</strong><strong>Auksion</strong>&raquo; Вы несете полную ответственность за свои действия и за последствия использования информации с сайта</p>\r\n\r\n<p>Содержание Сайта &laquo;<strong>Samauto</strong><strong>-</strong><strong>Auksion</strong>&raquo; не может быть скопировано, опубликовано, воспроизведено, передано или распространено любым способом, а также размещено в сети интернет или средствах массовой информации, на физических носителях, без предварительного письменного согласия оператора.</p>\r\n\r\n<p><strong>Обработка персональных данных</strong></p>\r\n\r\n<p>При использовании Сайта &laquo;<strong>Samauto</strong><strong>-</strong><strong>Auksion</strong>&raquo; Вы подтверждаете, что уведомлены и согласны на сбор, обработку и использование персональных данных.</p>\r\n\r\n<p>Целью сбора, хранения и обработки персональных данных является предоставление пользователю персонализированных сервисов сайта, в том числе: доступ в личный раздел, авторизация, напоминание пароля, в том числе направление уведомлений, обработка запросов Пользователя.</p>\r\n\r\n<p>Обработка Персональных данных включает в себя любые действия и/или совокупность действий, которые связаны со сбором, регистрацией, накапливанием, хранением, использованием, удалением Персональных данных Пользователя с целью обеспечения работы сервисов Сайта &laquo;<strong>Samauto</strong><strong>-</strong><strong>Auksion</strong>&raquo;.</p>\r\n\r\n<p style=\"margin-left:7.1pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:7.1pt\">&nbsp;</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 'соглашение_о_сотрудничестве_по_участию_на_онлайн_аукционе_pM_OB.doc'),
(7, 'Правила проведения онлайн аукционов', '', '', '<p><strong>1. Общие положения</strong></p>\r\n\r\n<p>1.1. В электронном онлайн-аукционе могут участвовать все юридические лица и сотрудники СП ООО &laquo;СамАвто&raquo; в качестве физических лиц, прошедшие регистрацию на сайте электронной торговой площадки&nbsp; &laquo;Samauto-Auksion&raquo;.</p>\r\n\r\n<p>1.2. Персональный кабинет и лицевой счет создается автоматически в период регистрации. Адрес электронной почты пользователя применяется в качестве логина для входа в персональный кабинет.</p>\r\n\r\n<p>1.3. Пароль для входа в персональный кабинет устанавливается пользователем самостоятельно, в процессе регистрации.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. Порядок проведения электронного онлайн-аукциона методом повышения цены</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2.1. Электронный онлайн-аукцион проводится еженедельно в пятницу с 9-00 до 18-00 часов.</p>\r\n\r\n<p>2.2. Цена, равная оценочной стоимости товара аукциона, устанавливается как стартовая цена.</p>\r\n\r\n<p>2.3. Электронный онлайн-аукцион начинается с предложением цены лота участников аукциона, увеличенной на один шаг от его стартовой цены.</p>\r\n\r\n<p>2.4. Шаг аукциона устанавливается:</p>\r\n\r\n<p>5 процентов от оценочной стоимости товара аукциона, то есть при каждом предложении участника цена поднимается на 5% от оценочной стоимости товара.</p>\r\n\r\n<p>2.5. Последний участник, подтвердивший предложение о цене лота, признается победителем.</p>\r\n\r\n<p>2.6.. Если участник аукциона проинформирует оператора о том, что не желает купить товар в течение пяти рабочих дней с момента объявления его победителем или полностью не выплатит стоимость товара, считается что он отказался от покупки. В таком случае победителем считается участник, сделавший предпоследнюю ставку.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3. Признание онлайн-аукциона несостоявшимся</strong></p>\r\n\r\n<p>3.1. Электронный онлайн-аукцион признается несостоявшимся в следующих случаях:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>если участники не подтвердили предложенную стоимость товара;</p>\r\n\r\n<p>если победитель аукциона и участник, сделавший предпоследнюю ставку, полностью не оплатили стоимость имущества в установленный срок.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4. Порядок проведения повторного онлайн-аукциона по выставленным, но не проданным товарам </strong></p>\r\n\r\n<p>4.1. Повторный аукцион проводится на следующей неделе, после недели признания электронного онлайн-аукциона несостоявшимся.</p>\r\n\r\n<p>4.2. Повторный аукцион проводится с понедельника 9-00 до 18-00 пятницы.</p>\r\n\r\n<p>4.3. Стартовой ценой товара устанавливается цена, равная 80 процентам от предыдущей стоимости.</p>\r\n\r\n<p>4.4. Повторный аукцион начинается с запроса от участников аукциона подтверждения предложения о стоимости товара.</p>\r\n\r\n<p>4.5. Если один из участников подтверждает объявленную цену лота, то остальным участникам аукциона предлагается подтвердить предложение о цене лота, увеличенной на 5 процента от подтвержденной цены.</p>\r\n\r\n<p>4.5 &nbsp;Победителем аукциона признается участник, последним подтвердивший предложение о цене лота до 18.00 часов пятницы.</p>\r\n\r\n<p>4.6. Если участник аукциона проинформирует оператора о том, что не желает купить товар в течение пяти рабочих дней с момента объявления его победителем или полностью не выплатит стоимость имущества, считается что он отказался от покупки. В таком случае победителем считается участник, сделавший предпоследнюю ставку.</p>\r\n\r\n<p>.</p>\r\n\r\n<p><strong>6. Признание повторного аукциона несостоявшимся</strong></p>\r\n\r\n<p>6.1. Повторный аукцион признается несостоявшимся в следующих случаях:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>никто из участников аукциона не изъявил желание купить имущество по предложенной в ходе аукциона цене;</p>\r\n\r\n<p>если победитель аукциона и участник, сделавший предпоследнюю ставку и которому было предложено приобрести имущество в установленном порядке, полностью не оплатили стоимость имущества в установленный срок.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>7. Порядок расчетов и оформления прав на товары аукциона</strong></p>\r\n\r\n<p>7.1. Победитель аукциона не позднее пяти рабочих дней со дня завершения онлайн-аукциона должен полностью оплатить стоимость реализованного на аукционе товара.</p>\r\n\r\n<p>7.2. Не позднее следующего рабочего дня после полной оплаты победителем стоимости товара аукциона сотрудник ДБУ оформляет все необходимые документы по реализации товара.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 'правила проведения аукциона_LQ7RV.docx');
